import React from 'react'
import Services from './Services'
import About from './About'
import Contact from './Contact'

function index() {
    const menu = useSelector(state=>state)
    return (
        <div>
            {state.Menu}
            <Services />
            <About />
            <Contact />
        </div>
    )
}

export default index
